import React from 'react';

import { requestFiveDayPrediction } from "../weatherAPI";
import MultiplePredictions from './MultiplePredictions';

class WeatherCard extends React.Component {

  render() {
    console.log(this.props);
    return (
      <div>
        Card
        <MultiplePredictions code={this.props.code}/>
      </div>
    );
  }
}

export default WeatherCard;
